 @eloquentno7435  its a fuckin policy and etiquette within the community to not associate former personas with current personas. Everyone knows some of the identities of the hologirls but we dont go screaming about it, Its called manners and respect. 

And you say that if she shouldnt want people to know then why didnt she delete her old channel. Because 1.) its a personal choice, she probably has attachment to it and 2.) if she ever gets fired from hololive she will atleast have her old channel to go back to. 

So even if you know the past of these girls.... you think they will notice you? No way man... Calli even said she was bothered by it when people knew who she was and ask personal stuff about it. These girls are idols not your typical streamers.
